import React from 'react'
import { objectImg } from 'utils/objectImg'
import * as Style from './styles'

interface ButtonControl {
  range: number
  onClick?: any
}

const ButtonControl = ({ range, onClick }: ButtonControl) => {
  return (
    <Style.Container color={objectImg[range].color} onClick={() => onClick(range)}>
      <Style.Wrapper>{range != 3 && <img src={objectImg[range].img} alt="paper" />}</Style.Wrapper>
    </Style.Container>
  )
}

export default ButtonControl
